// Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import BentoBoxes from '../components/BentoBoxes';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Home = () => {
    return (
        <Container fluid className="dark:bg-theme-dark-background text-theme-light-text dark:text-theme-dark-text h-screen overflow-hidden d-flex flex-column justify-content-between">
            <Row className="pt-8 pl-8 pr-8 justify-content-between align-items-center">
                <Col xs="auto" className="text-4xl font-bold">Home</Col>
            </Row>
            <Row className="flex-grow-1 p-8">
                <BentoBoxes />
            </Row>
            <Row className="pr-12 pl-12 pb-5 align-items-center justify-content-between"> {/* Adjusted for new layout */}
                <Col xs="auto"><Button variant="primary">Speech to Text</Button></Col> {/* Left */}
                <Col md={6} className="d-flex justify-content-center">
                    <Form.Control type="search" placeholder="Search" />
                </Col>
                <Col xs="auto"><Button variant="primary">Settings</Button></Col> {/* Right */}
            </Row>
        </Container>
    );
};

export default Home;
